window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"27.0.2","implementation":{"version":"8.2.1 (playwright 1.51.0)","name":"playwright-bdd"},"cpu":{"name":"x64"},"os":{"name":"win32","version":"10.0.19045"},"runtime":{"name":"node.js","version":"20.11.1"}}},{"source":{"data":"Feature: ExerciseCreate Feature\r\n\r\n  Background:\r\n    Given I am connected as a user\r\n    And Display a new exercise form\r\n\r\n    @Automated\r\n    Scenario: Change duration of exercise\r\n      When I change the duration of the exercise to \"1 heure\"\r\n      Then \"1 heure\" should be the selected duration\r\n\r\n    @Automated\r\n    Scenario: Create a new exercise\r\n      When I fill a new exercise form with valid data\r\n      Then I am redirected to the current exercise\r\n    \r\n    Scenario: Wrong title for exercise\r\n      When I enter 'a' in field 'name'\r\n      # When I enter an invalid value in the exercise field\r\n      # When I select '15 minutes' from field 'duration'\r\n      Then It should display error 'exercise.form.name.error.minlength'\r\n\r\n    @Automated\r\n    Scenario Outline: Wrong data for exercise\r\n      When I enter '<value>' in field '<fieldName>'\r\n      # When I enter an invalid value in the exercise field\r\n      # When I select '15 minutes' from field 'duration'\r\n      Then It should display error '<errorKey>'\r\n\r\n      Examples: \r\n      | value | fieldName | errorKey |\r\n      | a     | name      | exercise.form.name.error.minlength |\r\n\r\n    @Automated\r\n    Scenario: Trial to create a new exercise with negative iteration nb\r\n      When I add a negative figure to the iteration nb\r\n      Then It should display the following error exercise.form.exquisiteCorpse.nbIterations.error.min \r\n\r\n    Scenario: Trial to create a new exercise with an invalid mini-word number\r\n      When I add an invalid figure to the mini-word field\r\n      Then It should display the following error exercise.form.exquisiteCorpse.words.minWords.error.min \r\n    \r\n    Scenario: Trial to create a new exercise with an invalid maxi-word number\r\n      When I add an invalid figure to the maxi-word field\r\n      Then It should display the following error exercise.form.exquisiteCorpse.words.maxWords.error.min\r\n    \r\n    @Automated\r\n    Scenario: Try to create a new exercise without any history content\r\n      When I do not add content in the initialText field\r\n      Then It should display the following error exercise.form.exquisiteCorpse.initialText.error.required ","uri":"[chromium]:e2e\\features\\exercise\\exerciseCreate.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"ExerciseCreate Feature","description":"","children":[{"background":{"id":"d6f33a6f-728e-4e86-ada2-d58ae4d15301","location":{"line":3,"column":3},"keyword":"Background","name":"","description":"","steps":[{"id":"cf2b0514-1eb5-498f-956f-bc8edaff60e4","location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"I am connected as a user"},{"id":"8933487a-dc76-4992-8947-1de9adaa8e05","location":{"line":5,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"Display a new exercise form"}]}},{"scenario":{"id":"ad3015de-7963-48a7-ab48-8496ccf7a93a","tags":[{"location":{"line":7,"column":5},"name":"@Automated","id":"77166dbb-1ada-4f09-8e81-81e447d322a1"}],"location":{"line":8,"column":5},"keyword":"Scenario","name":"Change duration of exercise","description":"","steps":[{"id":"43a3231d-621f-4745-9568-3b8346123c1f","location":{"line":9,"column":7},"keyword":"When ","keywordType":"Action","text":"I change the duration of the exercise to \"1 heure\""},{"id":"5fa5a18f-acf2-4059-bbc8-39a4bca36084","location":{"line":10,"column":7},"keyword":"Then ","keywordType":"Outcome","text":"\"1 heure\" should be the selected duration"}],"examples":[]}},{"scenario":{"id":"0049c0a8-b325-4311-b4a0-3b1 <style>
a.view-trace {
  text-decoration: none; 
  color: #297bde;
}

a.view-trace:hover {
  text-decoration: underline;
}
</style>
<script>
function updateTraceViewLink(link) {
  if (!isHttpUrl(window.location.href)) return;
  var urlObj = new URL(link.href);
  var traceUrl = urlObj.searchParams.get('trace') || '';
  if (!isHttpUrl(traceUrl)) {
    traceUrl = new URL(traceUrl, window.location.href).href;
    urlObj.searchParams.set('trace', traceUrl);
    link.href = urlObj.href;
  }
}
function isHttpUrl(url) {
  return url.startsWith('http://') || url.startsWith('https://');
} 
</script>


<script>
function copyPrompt(button, prompt) {
  var originalText = button.textContent;
  if (originalText === 'Copied') return;
  navigator.clipboard.writeText(prompt).then(() => {
    button.textContent = 'Copied';
    setTimeout(() => button.textContent = originalText, 2000);
  });
}
</script>
